import React, { Component } from 'react';

class ContactMe extends Component {
    state = {  }
    render() { 
        return ( 
            <div>
                <form>
                    <input type="text" placeholder="Name" />
                    <input type="text" placeholder="Email Id" />
                    <input type="text" placeholder="Message"/>
                </form>
            </div> 
        );
    }
}
 
export default ContactMe;
